const LinkedIn: React.FC<React.SVGProps<SVGSVGElement>> = () => (
  <svg width="40" height="40" fill="none" xmlns="http://www.w3.org/2000/svg">
    <circle opacity=".72" cx="20" cy="20" r="20" fill="#0077B5" />
    <rect x="10" y="16.5" width="5" height="14" rx=".5" fill="#fff" />
    <ellipse cx="12.48" cy="12" rx="2.48" ry="2.5" fill="#fff" />
    <path
      d="M26.5 30.5h3a.5.5 0 00.5-.5v-8.4c0-3.77-2.13-5.6-5.11-5.6a4.21 4.21 0 00-3.17 1.27A.41.41 0 0121 17a.5.5 0 00-.5-.5h-3a.5.5 0 00-.5.5v13a.5.5 0 00.5.5h3a.5.5 0 00.5-.5v-7.5a2.5 2.5 0 015 0V30a.5.5 0 00.5.5z"
      fill="#fff"
    />
  </svg>
);
export default LinkedIn;
